            ======= Example =======
            IProject project = GetCurrentProject();
            // say we need to use it as an MSBuild project, if possible
            IMSBuildProject msbuild = project.As<IMSBuildProject>();
            if (msbuild != null)
                // do MSBuild stuff with it.
            ======= Adapters =======
            public class ProjectToMsBuildAdapter : IAdapter<IProject, IMSBuildProject>
            {
                // Implement actual conversion.
            }

            The conversion behavior is now decoupled from the usage.

Are you sick of Add Reference dialog box inside Visual Studio? I am. So here it is. From now on, add your references from PMC (Package Manager Console). For instance, in order to add System.Web as reference, type this; 

Add-Reference System.Web

in order to remove System.Web, type this; 

Remove-Reference System.Web
